Eu sou o Mistral e sou um sobrevivente, por isso temos que celebrar a vida, né? Olha só minha história: eu e meus irmãozinhos fomos abandonados com apenas algumas horas de vida em uma madrugada chuvosa. Imagina 6 felininhos recém nascidos sem nenhum suporte e ainda passando frio na madrugada? Infelizmente nenhum dos meus irmãozinhos conseguiu sobreviver, só eu, que resisti bravamente e hoje estou assim: lindo e saudável.

Eu fui cuidado por uma protetora muito bacana até que estivesse bem o suficiente para vir aqui para a ONG. Ainda sou novinho e não vejo a hora de ter uma vida muito legal ao lado de paizinhos carinhosos. Vamos formar uma família? ❤ 

