;a:1:{s:10:"short_code";s:11:"CEub0ayHONt";}i:223;a:1:{s:12:"created_time";i:1599245952;}i:224;a:1:{s:7:"caption";s:1078:"Oi pessoal. Depois de bastante tempo sem postar, retomamos com esse post bastante importante. 

Esses 4 machos apareceram aqui na chácara entre a primavera passada e este inverno. Todos já foram castrados e vacinados contra a raiva. Eram ariscos antes da esterilização mas depois se tornaram gatos muito dóceis, falantes, carinhosos e que gostariam de ficar dentro de casa (sim, eles pedem para entrar). 
Infelizmente não é possível introduzi Los no nosso gatil, pois já estamos em lotação máxima e fazer isso seria impor sofrimento a todos os gatos (os de dentro e de fora). 
Mas gostaria muito que eles vivessem em lares protegidos e assim tivessem chance de viver até a velhice. 
São gatos jovens, com cerca de um ano. 
Me comprometo de fazer antipulgas e vermifugacao antes de entrega-los ao adotante (lembrem-se: já estão castrados e vacinados contra raiva). A vacinação polivalente será responsabilidade do adotante. A adoção não precisa ser conjunta e será liberada apenas para apartamentos telados. 

